import React from 'react';
import logo from './logo.svg';
import './App.css';

const App = () => {
  return (
    <div>
    <Header />
    <div className="App">
        <ul>
          <li>html</li>
          <li>css</li>
          <li>javascript</li>
          <li>react</li>
        </ul>
    </div>
    </div>
  );
}

const Header = () =>{
  return(
    <div>
      <h1>home</h1>
      <h1>home123</h1>
      <h1>home456</h1>
      <h1>home789</h1>
    </div>
  );
}
export default App;
